import React, { useEffect } from 'react';

function Services() {
  useEffect(() => {
    // 页面加载时的淡入动画
    const servicesSection = document.querySelector('.services');
    servicesSection.style.opacity = '0';
    setTimeout(() => {
      servicesSection.style.transition = 'opacity 1s ease-in';
      servicesSection.style.opacity = '1';
    }, 100);
  }, []);

  return (
    <section className="services">
      <div className="services-header">
        <h2 className="animate-slide-up">MY SERVICES</h2>
      </div>
      <div className="container">
        <div className="service-section">
          <div className="service-text">
            <h3 className="animate-slide-up">GET HELP WITH Selling</h3>
            <p className="animate-slide-up">
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do
              eiusmod tempor incididunt ut labore et dolore magna aliqua.
            </p>
            <button className="btn animate-slide-up">Learn More</button>
          </div>
          <div className="service-image">
            <img
              src="/images/service-selling.jpg"
              alt="Selling Service"
              className="animate-fade-in"
            />
          </div>
        </div>
      </div>
    </section>
  );
}

export default Services;
